- Before calling `cast_or_null<Instruction>`, check if `VMap.count(DefMUDI)` is nonzero. Only then is there a mapping.
- If there is no mapping, immediately recurse on the defining access, as the clone did not produce a corresponding instruction.
- This matches the pattern used in other parts of LLVM for safe value mapping.

