responded: The crash persists even after using the correct idiom for map lookup. The stack trace shows the crash is now inside the DenseMap's handling of the key, which means the pointer being used as a key (`DefMUDI`) is likely invalid (dangling, deleted, or otherwise not a valid key for the map).

**Key insight:**  
- The code assumes that `DefMUDI` is always a valid, non-dangling pointer, but in some cases, it may be a pointer to a deleted or otherwise invalid instruction.
- Using such a pointer as a key in a DenseMap (or ValueMap) can cause assertion failures or crashes, even if you only use `find()`.

**LLVM best practice:**  
- Before using a pointer as a key in a ValueMap, ensure it is not only non-null, but also not deleted or otherwise invalid.
- In MemorySSA, instructions can be deleted after being replaced or optimized away. If `DefMUDI` is not present in `VMap`, it is safest to immediately recurse on the defining access, without even attempting to use it as a key.

**Final robust fix:**  
- If `DefMUDI` is not present in `VMap` (i.e., `find()` returns `end()`), immediately recurse on the defining access.
- Do not attempt to use `DefMUDI` as a key in the map if it is not present.

Let's implement this: only use `DefMUDI` as a key if it is present in `VMap`, otherwise immediately recurse.

