responded: Here is the robust patch for the `MemoryPhi` case:

- If `MPhiMap.lookup(DefPhi)` returns null, try to resolve the defining access for each operand of the phi recursively.
- If all operands resolve to the same defining access, return that; otherwise, return null (or propagate up).
- This matches the SSA updater idiom and prevents assertion failures or null dereferences.

